import {Link} from 'react-router-dom'

import './index.css'

const NavLink = props => {
  const {isActive, eachLink, clickNavLink} = props

  const onClickNav = () => {
    clickNavLink(eachLink.id)
  }

  return (
    <Link className="nav-link" to={eachLink.to}>
      <li onClick={onClickNav}>{eachLink.name}</li>
    </Link>
  )
}

export default NavLink
